import React from 'react';
import styles from "./Banner.css";

interface BannerProps {
  imageURL : string
  textAlt ?: string
}

const Banner = ({imageURL, textAlt} : BannerProps) => {
  return (
    <header className={styles.bann}>
      <img
        src={imageURL}
        alt={textAlt}
      ></img>
    </header>
  );
};

export default Banner;
